import React from 'react'
import './NavBar.scss'

export default function NavBarMobile({checked,list}) {
	return (
		<div style={{opacity:checked?'1':'0'}} className="NavBarMobile">
			{list}
		</div>
	)
}

export function NavBarDesktop() {
	return (
		<div className="NavBarDesktop">
			
			fsdfd
		</div>
	)
}
